import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todo, settodo] = useState()

  useEffect( () => {
    axios.get('/todos')
      .then(res => {
        console.log(res)
        settodo(res.data)
      })
      .catch(err => {
        console.log(err)
      })

  },[])
  return (
    <div className="App">
        <p> Hello </p>
        {
          todo.map( data => {
            <p>data.title</p>
          })
        }

    </div>
  );
}

export default App;
